from collections import defaultdict
from typing import List

def isAnagram(s: str, t: str) -> bool:
        map = {}
        if (len(s) != len(t)):
            return False
        for ltr in s:
            if (ltr not in map):
                map[ltr] = 1
            else:
                map[ltr] += 1
        for idx, ltr2 in enumerate(t):
            if (ltr2 in map):
                if (map[ltr2] == 0):
                    print("here2", ltr2)
                    return False
                map[ltr] -= 1
            else:
                print("here3")
                return False
        return True
            
s = ''
t = ''
